import React from 'react'
import './Scalp.css';
import TradingViewWidget from 'react-tradingview-widget';

export default function Scalp() {

// let width = TradingViewWidget.width = '980px'
// let heighty = TradingViewWidget.height = '610px'
let themey = TradingViewWidget.theme = 'Dark' ;
let indicators =  TradingViewWidget.studies = [ "TripleEMA@tv-basicstudies",  "RSI@tv-basicstudies"]

return (

<div className="Charts">

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='1'
    studies={indicators}  
    hide_side_toolbar={false}
    autoSize='true' 

  />

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='3'
    studies={indicators}  
    hide_side_toolbar={false}
    autoSize='true' 

  />

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='15'
    studies={indicators}  
    hide_side_toolbar={false}

  />

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='45'
    studies={indicators}  
    hide_side_toolbar={false}

  />

</div>
)
}
